        public static Boolean IsFileLocked(FileInfo file)
        {
            FileStream stream = null;
            try
            {
                stream = file.Open(FileMode.Open, FileAccess.Read, FileShare.None);
            }
            catch (IOException)
            {
                return true;
            }
            finally { if (stream != null) stream.Close(); }
            return false;
        }

        public static void CheckIfFileIsFreeForDownload(string FileName, string FilePath, string FolderPath, string To, string subject, string filename, string Recipient)
        {
            Utilities SendFileToCA = new Utilities();
            if (File.Exists(filename) && !IsFileLocked(new FileInfo(filename)))
                SendFileToCA.SendEmail(Recipient, "Sureshs@advisory.com,Xavierf@advisory.com,ArnoldW@advisory.com", "Population Demographic Assessment", "Hi There, Please find the PPT attaached to this email. Best Regards, Team DARA", filename);
        }

        #region PPTGEN
        // Adds child parts and generates content of the specified part.
        private void CreateParts(PresentationDocument document)
        {
            ThumbnailPart thumbnailPart1 = document.AddNewPart<ThumbnailPart>("image/jpeg", "rId2");
            GenerateThumbnailPart1Content(thumbnailPart1);

            PresentationPart presentationPart1 = document.AddPresentationPart();
            GeneratePresentationPart1Content(presentationPart1);

            ThemePart themePart1 = presentationPart1.AddNewPart<ThemePart>("rId8");
            GenerateThemePart1Content(themePart1);

            SlidePart slidePart1 = presentationPart1.AddNewPart<SlidePart>("rId3");
            GenerateSlidePart1Content(slidePart1,
                T5H1,
                T5H2,
                T5H3,
